import Head from 'next/head';
import Layout from '../components/Layout';
import HeroImage from '../components/HeroImage';
import Header from '../components/Header';
import HamburguerButton from '../components/HamburguerButton';
import ScrollTop from '../components/ScrollTop';
import { SobreMi } from '../components/SobreMi';
import { ProyectsHome } from '../components/ProyectsHome';
import Footer from '../components/Footer';
import '../scss/mediaqueries.scss';

// import modules js
import sticky from './modules/sticky_footer.js';
// import hamburguerMenu from './modules/hamburguer_menu.js';
// import scrollTopButton from './modules/scroll-boton.js';
// import darkMode from './modules/darkMode.js';

const d = document;
const w = window;

d.addEventListener('DOMContentLoaded', (e) => {
  sticky('.header');
  hamburguerMenu('.panel-btn', '.panel', '.panel__menu-a');
  scrollTopButton('.scroll-top-btn');
  darkMode('#switch');
});

const Index = (props) => {
  return (
    <Layout>
      <Head>
        <title>Porfolio Dami√°n Vigo</title>
      </Head>
      <HeroImage />
      <Header />
      <HamburguerButton />
      <ScrollTop />
      <SobreMi />
      <ProyectsHome />
      <Footer />
    </Layout>
  );
};

export default Index;
